import { Container } from '@material-ui/core'
import React from 'react'

function HomeScreen__Section(props) {
    return (
        <div>
            <Container className={classes.sectionDiv} >
                <h1 style={{
                    margin: 'auto',
                    verticalAlign: 'center',
                    lineHeight: '51px'
                }} >{props.title}</h1>
            </Container>
        </div>
    )
}

export default HomeScreen__Section
